import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router";

function App() {
  return (
    <div className='container'>
      <div className="left">
      <Router>
             <Switch>
                 <Route path="/">

                        </Route>
                    </Switch>
            </Router> 
       <Navigation/>
      </div>
